DROP TABLE IF EXISTS `bill`;
CREATE TABLE `bill` (
  `id` int(4) NOT NULL auto_increment COMMENT '编号',
  `tradeName` varchar(50) default NULL COMMENT '商品名称',
  `unit` varchar(10) default NULL COMMENT '商品单位',
  `num` varchar(10) default NULL COMMENT '商品数量',
  `amount` varchar(10) default NULL COMMENT '账单金额',
  `supplier` varchar(50) default NULL COMMENT '供应商',
  `payment` int(2) default NULL COMMENT '是否付款',
  `createDate` datetime default NULL COMMENT '创建时间',
  PRIMARY KEY  (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=13425 DEFAULT CHARSET=utf8;

